rrollo-manejo.jpg',0,'2017-03-24 16:49:23','0000-00-00 00:00:00'),(27,'Riesgos-en-tu-trabajo','Riesgos-en-tu-trabajo','Aporta conocimientos t√©cnicos, habilidades y actitudes necesarias en la prevenci√≥n de riesgos laborales; y con la adquisici√≥n de estas herramientas evitar accidentes de trabajo y/o enfermedades ocupacionales, garantizando la seguridad de lo m√°s importante en nuestra empresa: Nuestros trabajadores.','Desarrollo','col-md-3 col-sm-3 mix	desarrollo destacados','#41B649','cover-desarrollo-riesgos.jpg',0,'2017-03-24 16:49:23','0000-00-00 00:00:00'),(28,'Sistema-de-gesti√≥n-en-salud-y-seguridad-en-el-trabajo','Salud-y-seguridad','Ampliar los conocimientos t√©cnicos, destrezas y actitudes necesarias para la ejecuci√≥n del Sistema de Gesti√≥n en Seguridad y Salud en el Trabajo; adem√°s de posicionar la empresa como una empresa segura para sus trabajadores y darle fiel cumplimiento a la meta: cero accidentes de trabajo y enfermedades ocupacionales.','Desarrollo','col-md-3 col-sm-3 mix	desarrollo destacados','#41B649','cover-desarrollo-gestion.jpg',0,'2017-03-24 17:08:01','0000-00-00 00:00:00'),(29,'Autoestima-en-equilibrio','Autoestima-en-equilibrio','Promover el reconocimiento de la autoestima como un componente socioafectivo esencial para una vida saludable y en equilibrio.','Desarrollo','col-md-3 col-sm-3 mix	desarrollo','#41B649','cover-desarrollo-autoestima.jpg',0,'2017-04-09 18:25:36','0000-00-00 00:00:00'),(30,'Endomercadeo','Endomercadeo','Ayuda a analizas la aplicaci√≥n concreta del mercadeo en la gesti√≥n de los recursos humanos de la empresa, lo que se ha denominado como Endomercadeo. El principio b√°sico de esta nueva especialidad es simple, la empresa, adem√°s del cliente externo, tiene un nuevo tipo de cliente, el interno, el propio trabajador al cual hay que vender ideas, culturas, pol√≠ticas, proyectos, etc.','Productividad','col-md-3 col-sm-3 mix	productividad','#7952A1','	cover-productividad-endomercadeo.jpg	',0,'2017-03-24 16:49:23','00